Superman v2 #61
Publisher:  DC Comics
Publication Date:  November 1991

Writer:  Roger Stern
Penciller:  Dan Jurgens and Brett Breeding
Inker:  Brett Breeding
Colorist:  Glenn Whitmore
Letterer:  John Costanza
Cover:  Dan Jurgens, Brett Breeding, and Glenn Whitmore

&quot;Time and Time Again, Again!&quot; Guest-starring the Metal Men. Superman has a tough decision to make. Is the mysterious Waverider attempting to destroy the time stream, or is he out to save many innocent lives from certain death. With the Linear Men hot on the golden time-traveler's trail, the Man of Steel does not have long to make up his mind.

Thanks goes to DobisP.R. for this release.

